"use strict";(self.webpackChunkdocusaurus=self.webpackChunkdocusaurus||[]).push([[516],{6164:function(e){e.exports=JSON.parse('{"blogPosts":[{"id":"/2022/06/05/","metadata":{"permalink":"/dank-deploy/blog/2022/06/05/","source":"@site/blog/2022-06-05.md","title":"PRESSEMEDDELELSE: Salg af aktiver i \'Konge\xe5dalens Efterskoles Jubil\xe6um\'","description":"Horsens, 05. juni 2022","date":"2022-06-05T00:00:00.000Z","formattedDate":"5. juni 2022","tags":[],"readingTime":0.955,"truncated":true,"authors":[{"name":"Dover Art \'N\' Knowledge","title":"Presseansvarlig","url":"https://dank.mathiaslauridsen.dk","email":"math227v@gmail.com","key":"dank"}],"frontMatter":{"title":"PRESSEMEDDELELSE: Salg af aktiver i \'Konge\xe5dalens Efterskoles Jubil\xe6um\'","authors":"dank"},"nextItem":{"title":"DANK\'s 1 \xe5rs f\xf8dselsdag","permalink":"/dank-deploy/blog/2022/03/17/"}},"content":"## Horsens, 05. juni 2022\\r\\n![Umiddelbart efter salget gik igennem](/img/div/2022-06-05.01.jpg)\\r\\n*Fra venstre: Tommy Wulff Rasmussen, Museumsdirekt\xf8r Mathias M. Lauridsen, Lukas Even Holm-S\xf8rensen, & Anton S\xf8lyst Paulsen.*\\r\\n\\r\\nMed virkning fra d. 05. juni, 2022, vil tre k\xf8bere overtage samlet 50% af aktiverne i maleriet *Konge\xe5dalens Efterskoles Jubil\xe6um*. De tre k\xf8bere er alle velkendte ansigter blandt museets kendere, da alle tre har op til flere prominente roller i udstillingen. Anton S\xf8lyst Paulsen har k\xf8bt 12,50%, ligeledes har Lukas Even Holm-S\xf8rensen, og Tommy Wulff Rasmussen har k\xf8bt 25,00%.\\r\\n\x3c!-- truncate --\x3e\\r\\n> Det her er noget vi har arbejdet p\xe5 l\xe6nge, og jeg er bare s\xe5 glad for at salget endeligt er g\xe5et igennem. Det er en stor dag, b\xe5de for museet, men det er ogs\xe5 en stor personlig sejr.\\r\\n\\r\\n*\\\\- Mathias M. Lauridsen, Museumsdirekt\xf8r*\\r\\n\\r\\n## Ny kunst\\r\\nMaleriet er museets nyeste satsning. Maleriet er indk\xf8bt for kr. 600,00 p\xe5 auktion i Dover, men det ansl\xe5s allerede nu at v\xe6rdien er oversteget kr. 800,00.\\r\\n\\r\\nDu kan l\xe6se mere om maleriet - og al den anden kunst - [her](/docs/fysiske/ke25)\\r\\n\\r\\n---\\r\\n\\r\\nKontaktperson: Mathias M. Lauridsen, Museumsdirekt\xf8r, Dover Art \'N\' Knowledge, Telefon: +45 42 73 73 92."},{"id":"/2022/03/17/","metadata":{"permalink":"/dank-deploy/blog/2022/03/17/","source":"@site/blog/2022-03-17.md","title":"DANK\'s 1 \xe5rs f\xf8dselsdag","description":"DANK bliver grundlagt i Dover - Nyt kunstmuseum","date":"2022-03-17T00:00:00.000Z","formattedDate":"17. marts 2022","tags":[],"readingTime":0.745,"truncated":true,"authors":[{"name":"Mathias M. Lauridsen","title":"Formand, DANK","email":"math227v@gmail.com","imageURL":"/img/authors/math.jpg","key":"math"}],"frontMatter":{"title":"DANK\'s 1 \xe5rs f\xf8dselsdag","description":"DANK bliver grundlagt i Dover - Nyt kunstmuseum","authors":"math"},"prevItem":{"title":"PRESSEMEDDELELSE: Salg af aktiver i \'Konge\xe5dalens Efterskoles Jubil\xe6um\'","permalink":"/dank-deploy/blog/2022/06/05/"},"nextItem":{"title":"DANK Flytter","permalink":"/dank-deploy/blog/2021/06/26/"}},"content":"I dag blev *Dover Art \'N\' Knowledge* grundlagt for 1 \xe5r siden.\\r\\n\\r\\nTiden er fl\xf8jet. Men tiden er heller ikke g\xe5et spildt til. Siden vi slog d\xf8rene op i marts, sidste \xe5r, er der sket meget. Museet er flyttet, og kunst-udvalget er blevet forst\xf8rret gevaldigt. Vi har oplevet tyveri, vi blev snydt, og vi blev l\xf8jet for. Men vi oplevede ogs\xe5 hj\xe6lp, og vi skabte et f\xe6llesskab - Mona skulle findes, Mona skulle hjem.\\r\\n\x3c!-- truncate --\x3e\\r\\nI det forgange \xe5r, er mange nye v\xe6rker kommet til. Senest er *[Napoleona Bonaparte slays](/docs/fysiske/napo)* blevet indk\xf8bt, og det markere museets andet fysiske v\xe6rk. Dog er den digitale kollektion ogs\xe5 kommet til, med mange v\xe6rker fra husets kunstnere. \\r\\n\\r\\nAlt i alt, er der sket meget det sidste \xe5r - og der kommer til at ske meget fremadrettet. Store planer er undervejs, og i vil snart h\xf8rer mere.\\r\\n\\r\\nMathias M. Lauridsen,\\r\\nMuseumsdirekt\xf8r, DANK"},{"id":"/2021/06/26/","metadata":{"permalink":"/dank-deploy/blog/2021/06/26/","source":"@site/blog/2021-06-26.md","title":"DANK Flytter","description":"DANK\'s offentlige udstilling lukker, mens samlingen bliver flyttet til Aulum","date":"2021-06-26T00:00:00.000Z","formattedDate":"26. juni 2021","tags":[],"readingTime":0.635,"truncated":true,"authors":[{"name":"Mathias M. Lauridsen","title":"Formand, DANK","email":"math227v@gmail.com","imageURL":"/img/authors/math.jpg","key":"math"}],"frontMatter":{"title":"DANK Flytter","description":"DANK\'s offentlige udstilling lukker, mens samlingen bliver flyttet til Aulum","authors":"math"},"prevItem":{"title":"DANK\'s 1 \xe5rs f\xf8dselsdag","permalink":"/dank-deploy/blog/2022/03/17/"},"nextItem":{"title":"PRESSEMEDDELELSE: Mona Lisa er i sikkerhed","permalink":"/dank-deploy/blog/2021/06/06/"}},"content":"**K\xe6re alle.**\\r\\n\\r\\nEfter de sidste m\xe5neders kontroverser, har ledelsen besluttet at lukke den offentlige fysiske udstilling. I praksis betyder det, at Mona Lisa ikke l\xe6ngere er at finde i Dover. \\r\\n\x3c!-- truncate --\x3e\\r\\nDenne beslutning er naturligvis ogs\xe5 p\xe5virket af at museets lejekontrakt med Konge\xe5dalens Efterskole er udl\xf8bet.\\r\\n\\r\\nI den seneste tid er der sket adskillige succesfulde, og ogs\xe5 knap s\xe5 succesfulde tyverifors\xf8g. Senest her i for\xe5ret lykkedes det serieforbryder Tjommy[^1] at stj\xe6le v\xe6rket, som f\xf8rst efter 6 dages intens efters\xf8gning blev fundet.\\r\\n\\r\\nDer er stadig mulighed for at se Mona Lisa, efter aftale hos privatsamlingen i Aulum. Kontakt undertegnet for mere info.\\r\\n\\r\\n[^1]: Dover Art \'N\' Knowledge er bekendt med hans sande identitet, men har efter henvendelse fra Tommy Wulff Rasmussen valgt ikke at bringe denne."},{"id":"/2021/06/06/","metadata":{"permalink":"/dank-deploy/blog/2021/06/06/","source":"@site/blog/2021-06-06.md","title":"PRESSEMEDDELELSE: Mona Lisa er i sikkerhed","description":"DANK bliver grundlagt i Dover - Nyt kunstmuseum","date":"2021-06-06T00:00:00.000Z","formattedDate":"6. juni 2021","tags":[],"readingTime":0.475,"truncated":true,"authors":[{"name":"Dover Art \'N\' Knowledge","title":"Presseansvarlig","url":"https://dank.mathiaslauridsen.dk","email":"math227v@gmail.com","key":"dank"}],"frontMatter":{"title":"PRESSEMEDDELELSE: Mona Lisa er i sikkerhed","description":"DANK bliver grundlagt i Dover - Nyt kunstmuseum","authors":"dank"},"prevItem":{"title":"DANK Flytter","permalink":"/dank-deploy/blog/2021/06/26/"},"nextItem":{"title":"PRESSEMEDDELELSE: Mona Lisa er forsvundet","permalink":"/dank-deploy/blog/2021/05/20/"}},"content":"**OPDATERING: MONA LISA ER TILBAGE I MUSEETS BESIDDELSE**\\r\\n\\r\\nDet kan n\xe6ppe v\xe6re g\xe5et nogens n\xe6se forbi, at Mona Lisa fra d. 20. maj i \xe5r har v\xe6ret ude af museets besiddelse. Maleriet har flere gange v\xe6ret tilbage, for kun kortvarigt efter at forsvinde igen. \\r\\n\x3c!-- truncate --\x3e\\r\\nMen efter et tip fra *Anton S\xf8lyst Paulsen*, blev Mona fundet, gemt n\xe6r museet. \\r\\n\\r\\nMuseumsdirekt\xf8ren oplyser, at Mona nu ikke l\xe6ngere er at finde p\xe5 museet. Derimod er Mona, under st\xe6rk fortrolighed, blevet flyttet til et sikkert opmagasineringslokale. Det vides endnu ikke hvorn\xe5r Mona forventes at komme hjem."},{"id":"/2021/05/20/","metadata":{"permalink":"/dank-deploy/blog/2021/05/20/","source":"@site/blog/2021-05-20.md","title":"PRESSEMEDDELELSE: Mona Lisa er forsvundet","description":"DANK ved i \xf8jeblikket ikke hvor Mona Lisa befinder sig","date":"2021-05-20T00:00:00.000Z","formattedDate":"20. maj 2021","tags":[],"readingTime":0.575,"truncated":true,"authors":[{"name":"Dover Art \'N\' Knowledge","title":"Presseansvarlig","url":"https://dank.mathiaslauridsen.dk","email":"math227v@gmail.com","key":"dank"}],"frontMatter":{"title":"PRESSEMEDDELELSE: Mona Lisa er forsvundet","description":"DANK ved i \xf8jeblikket ikke hvor Mona Lisa befinder sig","authors":"dank"},"prevItem":{"title":"PRESSEMEDDELELSE: Mona Lisa er i sikkerhed","permalink":"/dank-deploy/blog/2021/06/06/"},"nextItem":{"title":"Grundl\xe6ggelse","permalink":"/dank-deploy/blog/2021/03/17/"}},"content":"**OPDATERING: MONA LISA ER TILBAGE I MUSEETS BESIDDELSE**\\r\\n\\r\\nMona Lisa er dags dato forsvundet fra museet. Dette er ikke f\xf8rste gang, dog ser museumsdirekt\xf8ren p\xe5 dette med forh\xf8jet alvor:\\r\\n> Da vi m\xf8dte ind efter ferien, oplyser min kontaktperson mig om at Mona Lisa ikke l\xe6ngere er at finde.\\r\\n\x3c!-- truncate --\x3e\\r\\n\\r\\nDen store forskel, forklarer direkt\xf8ren, er at maleriet denne gang er stj\xe5let fra den ellers sikre lokation det var opbevaret p\xe5.\\r\\n> Vi troede at vi havde truffet de n\xf8dvendige sikkerhedsforanstaltninger, men det viser sig vi tog fejl. Stedet var ikke sikkert nok.\\r\\n\\r\\nHar du oplysninger som kan hj\xe6lpe museet med at sikre Mona Lisa hjem igen, kontakt gerne Museumsdirekt\xf8r Mathias M. Lauridsen."},{"id":"/2021/03/17/","metadata":{"permalink":"/dank-deploy/blog/2021/03/17/","source":"@site/blog/2021-03-17.md","title":"Grundl\xe6ggelse","description":"DANK bliver grundlagt i Dover - Nyt kunstmuseum","date":"2021-03-17T00:00:00.000Z","formattedDate":"17. marts 2021","tags":[],"readingTime":0.16,"truncated":true,"authors":[{"name":"Mathias M. Lauridsen","title":"Formand, DANK","email":"math227v@gmail.com","imageURL":"/img/authors/math.jpg","key":"math"}],"frontMatter":{"title":"Grundl\xe6ggelse","description":"DANK bliver grundlagt i Dover - Nyt kunstmuseum","authors":"math"},"prevItem":{"title":"PRESSEMEDDELELSE: Mona Lisa er forsvundet","permalink":"/dank-deploy/blog/2021/05/20/"}},"content":"Fra dags dato er der nu ny mulighed for at opleve kunst i Dover - hos Dover Art \'N\' Knowledge!\\r\\n\x3c!-- truncate --\x3e\\r\\nMuseet huser p\xe5 nuv\xe6rende tidspunkt den verdensber\xf8mte [Mona Lisa](/docs/fysiske/mona)."}]}')}}]);